<!DOCTYPE html>
<html lang="en">
  <head>
    <title>Model Explorer</title>

    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />

    <script type="module" crossorigin src="./index-TEGWN-tD.js"></script>
    <link rel="stylesheet" crossorigin href="./index-BYDTl6vC.css">
  </head>

  <body>
    <div id="main-graph-container" class="main-graph-container">
      <select id="graph-selector" hidden=""></select>

      <div class="graph-outer-container">
        <div class="graph-container">
          <div class="graph-header">
            <button id="resetZoom" onclick="resetZoom()" class="zoom-buttons">Reset Zoom</button>
            <div class="graph-title" id="top-graph-title"></div>
          </div>
          <div class="graph-inner-container">
            <canvas id="top-graph-canvas"></canvas>
          </div>
          <div class="graph-legend-container">
            <div id="top-graph-legend" class="graph-legend"></div>
          </div>   
        </div>

        <div class="graph-container">
          <div class="graph-header">
            <button id="resetZoom1" class="zoom-buttons">Reset Zoom</button>
            <div class="graph-title" id="top-graph-title1"></div>
          </div>
          <div class="graph-inner-container">
            <canvas id="top-graph-canvas1"></canvas>
          </div>
          <div class="graph-legend-container">
            <div id="top-graph-legend1" class="graph-legend"></div>
          </div>   
        </div>
      </div>
    </div>

    <div id="inputs-container" class="main-section">
      <div id="inputs-content"></div>
    </div>

    <div class="overlay-container"></div>
  </body>
</html>
